import React from "react";
import { useNavigate, useSearchParams } from "react-router-dom";

const Edit = () => {
    return (
        <>
            <div>Edit</div>
            <button onClick={() => setSearchParams({ who: "jojusun" })}>바꾸기</button>
            <button
                onClick={() => {
                    navigate("/");
                }}
            >
                home으로 가기
            </button>
            <button
                onClick={() => {
                    navigate(-1);
                }}
            >
                뒤로가기
            </button>
        </>
    );
};

export default Edit;
